import React from 'react';

function Hero() {
  return (
    <div className="bg-green-700 text-white py-12 text-center">
      <h1 className="text-4xl font-bold mb-3">MENU</h1>
      <div className="text-sm">
        <p className="mb-1">TYPE OF SERVICES AVAILABLE</p>
        <p>Pick-up • Delivery • Coffee Catering</p>
      </div>
    </div>
  );
}

export default Hero;
